import React, { useRef } from 'react';
import '../../assets/css/profilePage.css';
import { useNavigate } from 'react-router-dom';

function Headerbar() {

    const headerButtonRef = useRef(null);

    const methodf = ()=> {
        console.log(window.getComputedStyle(headerButtonRef.current).getPropertyValue('top'));
    }
    const navigate = useNavigate();
            const handleRedirect = (page) => {
            switch(page){
            case 'workPage':
                navigate('/work');
                break;
            case 'aboutPage':
                navigate('/about');
                break;
            case 'contactPage':
                navigate('/contact');
                break;
            }
    };

    return (
        <div className = "headerButtonContainer">
            <button className = "headerButton" ref={headerButtonRef} onClick={()=>methodf()}>test</button>
            <button className = "headerButton" onClick={()=>handleRedirect("workPage")}>Work</button>
            <button className = "headerButton" onClick={()=>handleRedirect("aboutPage")}>About</button>
            <button className = "headerButton" onClick={()=>handleRedirect("contactPage")}>Contact</button>
        </div>
    );
}

export default Headerbar;
